import React from "react"
import { Routers, Route } from 'react-router-dom'
import Signin from "./pages/Auth/SignIn";
import Signup from "./pages/Auth/SignUp";

function App() {
  return (
    <div>
      <Routers>
        <Route path='/auth/signup' element={<Signup />} />
      </Routers>
    </div>
  )
}

export default App;
